;; http://www.npr.org/2017/01/01/507567187/for-this-puzzling-retrospective-on-2016-youll-need-a-set-of-speakers

;; Take the four-letter men's names TODD, OMAR, DAVE and DREW. If you write them one
;; under the other, they'll form a word square, spelling TODD, OMAR, DAVE and DREW
;; reading down as well:

;; TODD
;; OMAR
;; DAVE
;; DREW

;; Can you construct a word square consisting of five five-letter men's names? Any such
;; square using relatively familiar men's names will count. I have an answer using four
;; relatively common names and one less familiar one.

(def letters-list
  [\a \b \c \d \e \f \g \h \i \j \k \l \m
   \n \o \p \q \r \s \t \u \v \w \x \y \z])


(def five-letter-mens-names
  (->> (slurp (clojure.java.io/resource "male_first_names_lower.txt"))
       clojure.string/split-lines
       (filter (comp (partial = 5) count))
       (map (comp seq char-array))))

(def five-letter-mens-names
  (->> (slurp (clojure.java.io/resource "male_first_names_lower.txt"))
       clojure.string/split-lines
       (filter (comp (partial = 5) count))
       (filter (partial re-find
           #"^[bcdfghklmnprstwy][aeiou][bcdfghklmnprstwy][aeiou][bcdfghklmnprstwy]$"
           ))
   ;    (map (comp seq char-array))
    ;   set
       )
  )


