(use 'clojure.core.logic)
(require '[clojure.core.logic.fd :as fd])

(run* [a1 b1 c1 d1 e1
       a2 b2 c2 d2 e2
       a3 b3 c3 d3 e3
       a4 b4 c4 d4 e4
       a5 b5 c5 d5 e5]
      (membero (seq [a1 b1 c1 d1 e1]) five-letter-mens-names)
      (membero (seq [a2 b2 c2 d2 e2]) five-letter-mens-names)
      (membero (seq [a3 b3 c3 d3 e3]) five-letter-mens-names)
      (membero (seq [a4 b4 c4 d4 e4]) five-letter-mens-names)
      (membero (seq [a5 b5 c5 d5 e5]) five-letter-mens-names)
      (membero (seq [a1 a2 a3 a4 a5]) five-letter-mens-names)
      (membero (seq [b1 b2 b3 b4 b5]) five-letter-mens-names)
      (membero (seq [c1 c2 c3 c4 c5]) five-letter-mens-names)
      (membero (seq [d1 d2 d3 d4 d5]) five-letter-mens-names)
      (membero (seq [e1 e2 e3 e4 e5]) five-letter-mens-names)
      (== b1 a2)
      (== c1 a3)
      (== d1 a4)
      (== e1 a5)
      (== c2 b3)
      (== d2 b4)
      (== e2 b5)
      (== d3 c4)
      (== e3 c5)
      (== d5 e4)
      )


(run* [a1 b1 c1 d1 e1
       a2 b2 c2 d2 e2
       a3 b3 c3 d3 e3
       a4 b4 c4 d4 e4
       a5 b5 c5 d5 e5]
      (membero (seq [a1 b1 c1 d1 e1]) five-letter-mens-names)
      (membero (seq [a1 a2 a3 a4 a5]) five-letter-mens-names)
      (== b1 a2)
      (membero a1 letters-list)
      (membero a2 letters-list)
      (membero b1 letters-list)
      (!= (seq [a1 b1 c1 d1 e1]) (seq [a1 a2 a3 a4 a5]))
      )

